import React from "react"
import { Routes, Route } from "react-router-dom";
import { Productos } from "./Productos";
import { Categorias } from "./Categorias";
import { CategeoriaProductos } from "./CategoriaProductos";



export const Paginas = () => {
    return (
        <Routes>
            <Route path='/categorias' exact element={<Categorias />} />
            <Route path='/categorias/:nombre' exact element={<CategoriasProductos />} />
            <Route path="/categorias/:nombre" render={({ match }) => {
                return <CategeoriaProductos nombre={match.params.nombre} />
            }} />
            <Route path='/' exact element={<Productos />} />
        </Routes>
    )
}
